import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Nayok name = "Jashim" />
      <Nayok name = "Manna" />
      <Nayok name = "Alamgir" />
      <Nayok />
    </div>
  );
}

function Nayok(props) {
  const nayokStyle = {
    border: '2px solid purple',
    margin: '20px'
  }
  return <>
    <section>
      <div style = {nayokStyle}>
        <h1>I {props.name}</h1>
        <h3>I have done 5 movies</h3>

      </div>
    </section>
  </>
}


export default App;
